import MovieCard from './card';
// import data from './data'

class Movies extends React.Component
{
    render()
    {
        let { data } = this.props;
    let movie = data.map(
        a => <MovieCard key={a.imdbID} {...a} />

    );
    return movie

    }
}

export default Movies;
